import React, { useReducer } from 'react';
import { MdAdd, MdOutlineSwapHoriz, MdClose } from "react-icons/md";

export default function ScreensMenus({windowsDispatch}) {
    const [submenus, submenuDispatch] = useReducer(submenusReducer, ['add', '', '', ''])
    return (
        <>
            <MenuButtonCont position={{
                gridRowStart: 'a0',
                gridColumnStart: 'a0'
            }}>
                <MenuButtons windowsDispatch={windowsDispatch} submenuDispatch={submenuDispatch} position={0}></MenuButtons>
                <Submenu menu={submenus[0]} position={0} windowsDispatch={windowsDispatch} submenuDispatch={submenuDispatch}></Submenu>
            </MenuButtonCont>
            <MenuButtonCont position={{
                gridRowStart: 'a1',
                gridColumnEnd: 'a1',
                marginLeft: 'auto'
            }}>
                <Submenu menu={submenus[1]} position={1} windowsDispatch={windowsDispatch} submenuDispatch={submenuDispatch}></Submenu>
                <MenuButtons windowsDispatch={windowsDispatch} submenuDispatch={submenuDispatch} position={1}></MenuButtons>
            </MenuButtonCont>
            <MenuButtonCont position={{
                gridRowEnd: 'a2',
                gridColumnStart: 'a2',
                marginTop: 'auto'
            }}>
                <MenuButtons windowsDispatch={windowsDispatch} submenuDispatch={submenuDispatch} position={2}></MenuButtons>
                <Submenu menu={submenus[2]} position={2} windowsDispatch={windowsDispatch} submenuDispatch={submenuDispatch}></Submenu>
            </MenuButtonCont>
            <MenuButtonCont position={{
                gridRowEnd: 'a3',
                gridColumnEnd: 'a3',
                marginTop: 'auto',
                marginLeft: 'auto'
            }}>
                <Submenu menu={submenus[3]} position={3} windowsDispatch={windowsDispatch} submenuDispatch={submenuDispatch}></Submenu>
                <MenuButtons windowsDispatch={windowsDispatch} submenuDispatch={submenuDispatch} position={3}></MenuButtons>
            </MenuButtonCont>
        </>
    );
}

function MenuButtonCont({position, children}) {
    return (
        <div style={{
            ...position,
            width: 'min-content',
            height: 'min-content',
            display: 'flex',
            backgroundColor: 'darkgray',
            zIndex: '2'
        }}>
            {children}
        </div>
    );
}

function MenuButton({onClick, children}) {
    return (
        <button onClick={onClick} style={{
            backgroundColor: 'transparent',
            border: 'none',
            margin: '0',
            padding: '0.3em'
        }}>
            {children}
        </button>
    );
}

function MenuButtons({position, submenuDispatch, windowsDispatch}) {
    return (
        <div style={{
            display: 'flex',
            flexDirection: 'column',
        }}>
            <MenuButton onClick={() => {windowsDispatch({
                type: 'remove',
                position: position
            })}}>
                <MdClose />
            </MenuButton>
            <MenuButton onClick={() => {submenuDispatch({
                position: position,
                menu: 'swap'
            })}}>
                <MdOutlineSwapHoriz />
            </MenuButton>
            <MenuButton onClick={() => {submenuDispatch({
                position: position,
                menu: 'add'
            })}}>
                <MdAdd />
            </MenuButton>
        </div>
    );
}

function SubmenuButton({action, position, screen, windowsDispatch, children}) {
    return (
        <button style={{
            border: 'none',
            backgroundColor: 'transparent',
            padding: '0.3em'
        }} onClick={() => {windowsDispatch(
            action === 'add' ? {
                type: 'add',
                position: position,
                screen: screen
            } : {
                type: 'swap'
            }
        )}}>
            {children}
        </button>
    );
}

function Submenu({menu, position, windowsDispatch, submenuDispatch}) {
    return (
        <div style={{
            display: menu ? 'flex' : 'none',
            flexDirection: 'column',
            backgroundColor: 'lightgray'
        }}>
            <SubmenuButton action={menu} position={position} windowsDispatch={windowsDispatch} screen={'home'}>Home</SubmenuButton>
            <SubmenuButton action={menu} position={position} windowsDispatch={windowsDispatch} screen={'phonology'}>Phonology</SubmenuButton>
            <SubmenuButton action={menu} position={position} windowsDispatch={windowsDispatch} screen={'grammar'}>Grammar</SubmenuButton>
            <SubmenuButton action={menu} position={position} windowsDispatch={windowsDispatch} screen={'lexicon'}>Lexicon</SubmenuButton>
            <SubmenuButton action={menu} position={position} windowsDispatch={windowsDispatch} screen={'tools'}>Tools</SubmenuButton>
            <SubmenuButton action={menu} position={position} windowsDispatch={windowsDispatch} screen={'settings'}>Settings</SubmenuButton>
            <button style={{

            }} onClick={() => {submenuDispatch({
                position: position,
                menu: ''
            })}}>Close</button>
        </div>
    );
}

function submenusReducer(submenus, action) {
    return submenus.with(action.position, action.menu)
}
